function ResultsListComponent() {
    const data ={

        "results" :[
          {
            "coursename":"John",
            "studentname":"Doe",
            "score":"25"
          },
          {
            "coursename":"Jack",
            "studentname":"Brown",
            "score":"24"
          },
          {
            "coursename":"Oliver",
            "studentname":"Black",
            "score":"30"
          },
        ]
      }

    return (
    <div className="container">
        <h1>Results Lists</h1>

        <table className="table">
          <thead>
            <tr>
              <td>Course</td>
              <td>Student</td>
              <td>Score</td>
            </tr>
          </thead>
          <tbody>
            {data.results.map((item, i) => (
              <tr key={i}>
                <td>{item.coursename}</td>
                <td>{item.studentname}</td>
                <td>{item.score}</td>
              </tr>
            ))}
          </tbody>
        </table>

    </div>
    )
}

export default ResultsListComponent
